completion:
Find all image tags that are not closed properly and replace them with self-closing image tags. 

RegEx: 
Find: &lt;img([^>]*)\&gt;
Replace with: &lt;img\1 /&gt;

Content-Type for a MIME Mail Message: 
- Content-Type: multipart/mixed;
- Content-Type: text/plain;
- Content-Type: image/jpeg;
- Content-Type: application/pdf;

Non-Mime Mail Message:
- Content-Type: text/html;
- Content-Type: text/plain;
